import React from "react";

class Search extends React.Component {
    constructor(props) {
        super(props);
        this.state={}
    }
    render() {
        return(
            <div className='search'>
                <div>
                    <input type="search"/>
                </div>
            </div>
        )
    }
}
export default Search;
